import React from 'react';

const RegisterPage = () => {
  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100">
      <h2 className="text-2xl font-bold mb-4">Register</h2>
      <form className="bg-white p-6 rounded shadow-md w-full max-w-sm">
        <label className="block mb-2">
          Email
          <input type="email" className="w-full border p-2 rounded" placeholder="you@example.com" />
        </label>
        <label className="block mb-4">
          Password
          <input type="password" className="w-full border p-2 rounded" placeholder="••••••••" />
        </label>
        <button type="submit" className="bg-green-500 text-white px-4 py-2 rounded w-full hover:bg-green-600">
          Register
        </button>
      </form>
    </div>
  );
};

export default RegisterPage;
